<script>
    function differentStrings(s,t){
        var diff=[];
        for (var i = 0; i < Math.max(s.length, t.length); i++){
            if(s[i]!==t[i]){
                diff.push(s[i]);
            }
        }
        return diff;
    }

    var s="abcdee";
    var t="abcdef";
    console.log(differentStrings(s,t));
</script>
